//function for interpreting ARRAY_H_JLM_EFG
double h_jlm_efg(int j, int ell, int m, int e, int f, int g){

  if(g<0 || g>ell+m || ell<0 || ell>=NMUMAX || m<0 
     || m>=NMUMAX || j<0 || j>ell+m || e<0 || e>ell+m-g
     || f<0 || f>g ){
    cout << "ERROR: h_jlm_efg: invalid index" << endl;
    cout << "h_jlm_efg inputs: j=" << j << ", ell=" << ell
         << ", m=" << m << ", e=" << e << ", f=" << f
         << ", g=" << g << endl;
    abort();
  }
  if(m>ell) return (g>=f+isodd(e) ? h_jlm_efg(j,m,ell,e,g-isodd(e)-f,g) : 0);
  int ell2=ell*ell, ell3=ell2*ell, ell4=ell3*ell, ell5=ell4*ell,ell6=ell5*ell;
  int m2=m*m, m3=m2*m, m4=m3*m, m5=m4*m;
  int lm=ell+m, lm2=lm*lm, lm3=lm2*lm;
  int nhl = ( 62*ell6 + 231*ell5 + 215*ell4 - 45*ell3 - 97*ell2 - 6*ell) / 360;
  int nhm = (4*m5 + (20*ell + 25)*m4 + (40*ell2 + 100*ell + 50)*m3
    + (40*ell3 + 150*ell2 + 150*ell + 35)*m2
    + (20*ell4 + 100*ell3 + 150*ell2 + 70*ell + 6)*m) / 120;
  int nhj = ( lm3 + 6*lm2 + 11*lm + 6 ) * j / 6;
  int nhg = (lm+1)*g + lm*g*(g-1)/2 - (2*g-1)*(g-1)*g/6;
  int ih = nhl + nhm + nhj + nhg + (g+1)*e + f;
  return ARRAY_H_JLM_EFG[ih]; 
}

